import React from "react";
import "./Navbar.css"
import {Link} from "react-router-dom";


function Navbar() {
    return (
        <ul>
            <li>
                <Link to="/components/about/about.js">about</Link>
            </li>
        </ul>
    );
}

export default Navbar
